import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import "../index.css"
import "./dashboard.css"

const Dashboard = () => {
    const { each } = props
        const { total, text, color } = each
        const colorText = {
            color: `${color}`
        }
    return (
        <div>
        <nav className="navbar navbar-expand-lg navbar-light ">
            <ul className="navbar-nav d-flex flex-column">
                <li className="nav-item"><a className="nav-link" href="/dashboard">Dashboard</a></li>
                <li className="nav-item"><a className="nav-link" target="_blank" href="https://docs.google.com/forms/d/e/1FAIpQLSfPn1hyLZe9tfC8KfdicjaNDEuiyPm9Fw_-keaVZSh91YzdtA/viewform">Apply Now!</a></li>
                <li className="nav-item"><a className="nav-link" href="#">Requests</a></li>
            </ul>
        </nav> 
         <div className='d-flex flex-column align-items-center shadow course-container'>
                    <p className='fs-2' style={colorText}>{total} </p>
                    <p>{text} </p>
                </div>
        </div>
    );
};

export default Dashboard;
